export default function CartScreen(props){
    const productId =props.match.params.id;
    const qty = props.location.serach? Number(props.location.search.split('=')[1]) 
    : 1;
    return (
        <div>
            <h1> Crat Srceen</h1>
            <p>ADD TO CART : productId: {productId} Qty: {qty}
            </p>
        </div>
    );
}
